import React from "react";
import Footer from "../components/Footer";
import NavigationBar from "../components/NavigationBar";
import AboutUs from "../components/AboutUs";

const About = () => {
  return (
    <>
      <NavigationBar />
      <AboutUs />
      <Footer />
    </>
  );
};

export default About;
